import React from 'react';
import ImageDisplay from '../ImageDisplay/ImageDisplay';

function TranscriptionHistory({ allTranscriptions, imageUrls, cleanedTranscriptions }) {
  const uniqueTranscriptions = Array.from(new Set(allTranscriptions));
  const cleaned = cleanedTranscriptions || [];

  return (
    <div className="table-cell history-cell">
      <div className="history-display">
        <div className="history-log">
          <div style={{ display: 'grid', gridTemplateColumns: '1fr 1fr 1fr', gap: '16px', fontWeight: 'bold', marginBottom: 8 }}>
            <div>Original</div>
            <div>Images</div>
            <div>Cleaned</div>
          </div>
          {uniqueTranscriptions.length === 0 ? (
            <p style={{ color: '#888', fontStyle: 'italic' }}>
              History currently unavailable
            </p>
          ) : (
            uniqueTranscriptions.map((text, index) => {
              const images = imageUrls[index];
              const cleanedText = cleaned[index] || '';
              return (
                <div key={index} style={{ display: 'grid', gridTemplateColumns: '1fr 1fr 1fr', gap: '16px', alignItems: 'center', borderBottom: '1px solid #eee', padding: '4px 0' }}>
                  <div>{text}</div>
                  <div>{images && <ImageDisplay images={images} />}</div>
                  <div>{cleanedText}</div>
                </div>
              );
            })
          )}
        </div>
      </div>
    </div>
  );
}

export default TranscriptionHistory;
